import {BrowserRouter, Route, Routes} from "react-router-dom";

import Home from "./Pages/Home";
import React from "react"

function App(){
  return (
    <BrowserRouter>
    <Routes>
      <Route path ="/home" element = {<Home/>} />
      <Route path ="/" element = {<Home/>} />
      <Route path ="/home" element = {<Home/>} />
      <Route path ="/home" element = {<Home/>} />

    </Routes>
    </BrowserRouter>
  )
}
export default App;
// components
